import Container from "../components/atoms/Container";
import MainApp from "../components/layouts/MainApp";
import Card from "../components/molecules/Card/";
import CardImage from "../components/molecules/Card/CardImage";

export default function Home() {
  return (
    <MainApp>
      <Container>

        <Card width="250px" className=" h-72 shadow-md  mt-2 bg-green-400   " >
          <CardImage src={`https://images.unsplash.com/photo-1518825059470-fce76c93d450?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=925&q=80`}
            height="200px" className="object-cover rounded-t " />
          <div className="p-2 space-y-3 " >
            <div className="flex justify-between" >
              <div>$ 28 </div>
              <div>50 Items</div>
            </div>
            <div className="flex justify-between text-white" >
              <button className="px-4 py-1.5 bg-green-400 focus:outline-none">View</button>
              <button className="px-4 py-1.5 bg-green-400 focus:outline-none">Add To Cart</button>
            </div>
          </div>
        </Card>

      </Container>
    </MainApp>
  )
}
